import { Outlet, Link } from "react-router-dom";
import { useAuthContext } from "../contexts/AuthContext";
import Footer from "./Footer";
import Navbar from "./Navbar";


function Layout() {
  const { auth, logout } = useAuthContext();
  return (
    <div>
      {auth && <Navbar />}
      <main className="App">
        <Outlet />
        <Footer />
      </main>
    </div>
  );
}

export default Layout;
